import React from 'react';
// import ActiveLink from '../../../UiElements/NavLink/NavLink';
import Menu, { MenuItem, MenuLink } from './TopMenu.style';

const menuItems = [
  {
    id: 1,
    label: 'Blog',
    path: 'https://redq.io/blog/',
  },
  {
    id: 2,
    label: 'Supports',
    path: 'https://redqsupport.ticksy.com/',
  },
  {
    id: 3,
    label: 'Docs',
    path: 'https://redq.io/blog/documentation/',
  },
];

type MenuProps = {
  className?: string;
  onClick?: () => void;
};

const TopMenu = ({ className, onClick }: MenuProps) => {
  return (
    <Menu className={className}>
      {menuItems.map(item => (
        <MenuItem key={`top-menu--item${item.id}`} onClick={onClick}>
          <MenuLink target="_blank" href={item.path}>
            {item.label}
          </MenuLink>
        </MenuItem>
      ))}
    </Menu>
  );
};

export default TopMenu;
